import React from 'react';


const InfoList = (array) => {
  console.log('InfoList');
  return(
    <>
      <ul>
        {array.map((pair, key) => (
          <li>{pair[0]}: {pair[1]}</li>
        ))}
      </ul>
    </>
  )
}


export default InfoList;
